import React from 'react';
import "./WordRecommend.css"

const WordRecommend = () => {
    return(
      <div>
        <div className="keyword">By Keyword</div>
        <ul className="keyword-list">
            <li>Lipstick</li>
            <li>Foundation</li>
            <li>Blush</li>
            <li>EyeShadow</li>
            <li>Blonzer</li>
            <li>EyeBrow</li>
            <li>Eyeliner</li>
            <li>Mascara</li>
            <li>Nail Polish</li>
        </ul>
      </div>
    );

}

export default WordRecommend;
